import React, { useEffect, useState } from 'react';
import PropTypes from 'prop-types';
import clsx from 'clsx';
import { makeStyles } from '@material-ui/styles';
import {
  Card,
  CardHeader,
  CardContent,
  CardActions,
  Button,
  Divider,
  Table,
  TableBody,
  TableRow,
  TableCell,
  colors
} from '@material-ui/core';
import EditIcon from '@material-ui/icons/Edit';
import LockOpenIcon from '@material-ui/icons/LockOpenOutlined';
import PersonIcon from '@material-ui/icons/PersonOutline';
import moment from 'moment';
import { useDispatch, useSelector  } from 'react-redux';


import { Label } from 'components';
import { CustomerEdit, EnrollInProgram } from './components';
import  {getSelectedUser } from 'store/api-actions';
import { async } from 'validate.js';
import { FETCH_PROGRAM } from '../../../../../../graphql/queries/app-queries'
import { CREATE_USER_PROGRAMS } from '../../../../../../graphql/mutations/app-mutations'
import  {apiFetchData } from 'store/api-actions';



const useStyles = makeStyles(theme => ({
  root: {},
  content: {
    padding: 0
  },
  actions: {
    flexDirection: 'column',
    alignItems: 'flex-start',
    '& > * + *': {
      marginLeft: 0
    }
  },
  buttonIcon: {
    marginRight: theme.spacing(1)
  }
}));

const CustomerInfo = props => {
  const { user, className, ...rest } = props;

  const classes = useStyles();

  const dispatch = useDispatch();



  const [openEdit, setOpenEdit] = useState(false);

  const [openEnrol, setOpenEnroll] = useState(false);

  const setStoreData = async (data) =>{
    return await dispatch(getSelectedUser(data));
  }

  useEffect( () =>{
    if(user){
      console.log("User selected: " , user[0].user[0])
      setStoreData(user[0].user[0]);
    }    
  },[user,dispatch])




  const handleEditOpen = () => {
    setOpenEdit(true);
  };

  const handleEditClose = () => {
    setOpenEdit(false);
  };
  const handleEnroll = () => {
    setOpenEnroll(true);
  };

  const handleEnrollClose = () => {
    setOpenEnroll(false);
  };
  return (
    <Card
      {...rest}
      className={clsx(classes.root, className)}
    >
      <CardHeader title="User Details " />
      <Divider />
      <CardContent className={classes.content}>
        <Table>
          <TableBody>
            <TableRow>
              <TableCell>Status</TableCell>
              <TableCell>
                {user.designation_name}
                <div>
                  <Label
                    color={
                      user[0].user[0].status ? colors.green[600] : colors.orange[600]
                    }
                  >
                    {user[0].user[0].status
                      ? 'Enrolled'
                      : 'No verified'}
                  </Label>
                </div>
              </TableCell>
            </TableRow>
            <TableRow selected>
              <TableCell>Name</TableCell>
              <TableCell>{user[0].user[0].surname } {user[0].user[0].other_names}</TableCell>
            </TableRow>
            <TableRow>
              <TableCell>Gender</TableCell>
              <TableCell>{user[0].user[0].gender }</TableCell>
            </TableRow>
            <TableRow selected>
              <TableCell>Designation</TableCell>
              <TableCell>{user[0].designation_name }</TableCell>
            </TableRow>
            <TableRow>
              <TableCell>Role</TableCell>
              <TableCell>{user[0].level[0].level_name}</TableCell>
            </TableRow>
            <TableRow selected>
              <TableCell>Date Registered</TableCell>
              <TableCell>{moment(user[0].date_created).format('DD/MM/YYYY | HH:MM')}</TableCell>
            </TableRow>
          </TableBody>
        </Table>
      </CardContent>
      <CardActions className={classes.actions}>
        <Table>
          <TableBody>
            <TableRow selected>
              <TableCell>
                <Button onClick={handleEditOpen}>
                  <EditIcon className={classes.buttonIcon} />
                  Edit Client
                </Button>
              </TableCell>
              <TableCell>
                <Button onClick={handleEnroll}>
                  <EditIcon className={classes.buttonIcon} />
                  Enroll
                </Button>
              </TableCell>
            </TableRow>            
          </TableBody>
        </Table>

      </CardActions>

      <CustomerEdit
        user={user[0].user[0]}
        onClose={handleEditClose}
        open={openEdit}
      />

      <EnrollInProgram
        user={user[0].user[0]}
        onClose={handleEnrollClose}
        open={openEnrol}
      />
    </Card>
  );
};

CustomerInfo.propTypes = {
  className: PropTypes.string,
  //user: PropTypes.object.isRequired
};

export default CustomerInfo;
